// import { createMuiTheme } from '@material-ui/core/styles';

const theme = {
    fontFamily: {
        sansSerif: '-apple-system, "Helvetica Neue", Arial, sans-serif',
        mono: 'Menlo, Monaco, monospace'
    },
    colors: {
        text: '#333',
        background: '#fff',
        link: '#1eaaf1',
        linkHover: '#0d8ecf',
        border: '#ddd',
        warning: '#fff3cd',
        success: '#d4edda'
    }
};

export default theme;
